import React, {Component} from 'react'
var plus = require('../img/circleplus.png'),
    double = require('../img/doubleClomn.png');
class Nav extends Component{
    render(){
        return(
            <ul>
                <li>
                    <img src={double}/>
                </li>
            </ul>
        )
    }
}
